import React, { useState } from 'react';
import { render } from 'react-dom';
import { format } from 'date-fns';
import TimeRange from '../../components/TimelineSlider/App';
import {
  selectedInterval,
  timelineInterval,
  initialPoints,
} from './datesSource';

const Split = () => {
  const [selectedInterval, setSelectedInterval] = useState(selectedInterval);

  const handleIntervalChange = (newInterval) => {
    setSelectedInterval(newInterval);
  };

  return (
    <div>
      <div
        style={{
          width: '80vw',
          margin: '24px auto',
          background: '#fff',
          borderRadius: '20px',
        }}
      >
        캔버스 영역
      </div>
      <div
        style={{
          padding: '16px',
          background: '#fff',
          overflowX: 'scroll',
        }}
      >
        <div className="container">
          <div className="info">
            <span>Selected Interval: </span>
            {selectedInterval.map((d, i) => (
              <span key={d.getTime()}>{format(d, 'dd MMM, HH:mm')}</span>
            ))}
          </div>

          <TimeRange
            selectedInterval={selectedInterval}
            timelineInterval={timelineInterval}
            initialPoints={initialPoints}
            onChangeCallback={handleIntervalChange}
          />
        </div>
      </div>
    </div>
  );
};

export default Split;
